import React from 'react';
import './nav.css';

function Nav(props) {
  const linkTitle = props.value;
  const links = linkTitle.map((number) =>
    <li className='nav-link'>
      <a href={number[0]}>
        {number[1]}
        {console.log(number[1])}
      </a>
    </li>
  );

  return (
    <div className="navbar">
        <ul className="nav">
          {links}
        </ul>
      </div>
  );
}

export default Nav;
